INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, 62, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1, 2, "2025/01/31 12:00:00", 1000001, "カリン", 0.0, "2030/01/01 14:59:59", -416.5, 1, 3.414, 190804);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, 62, "ミッションをクリアして、\n報酬をゲットしましょう！", 1, 2, "2025/01/31 12:00:00", 1000002, "カリン", 0.0, "2030/01/01 14:59:59", -416.5, 2, 3.099, 190804);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, 63, "受け取ることができる\n報酬があるようです\n確認してみてください", 1, 2, "2025/01/31 12:00:00", 1000003, "カリン", 0.0, "2030/01/01 14:59:59", -416.5, 3, 2.801, 190804);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, 63, "報酬がもらえますよ！\nチェックしてみてください", 2, 2, "2025/01/31 12:00:00", 1000004, "カリン", 0.0, "2030/01/01 14:59:59", -416.5, 4, 0.0, 190804);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, 64, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 2, 1, "2025/01/31 12:00:00", 1000005, "カリン", 0.0, "2030/01/01 14:59:59", -363.0, 5, 2.12, 190804);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, 64, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1, 2, "2025/01/31 12:00:00", 1000006, "カリン", 0.0, "2030/01/01 14:59:59", -363.0, 6, 1.68, 190804);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (1, 64, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 2, 1, "2025/01/31 12:00:00", 1000007, "カリン", 0.0, "2030/01/01 14:59:59", -363.0, 7, 2.33, 190804);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10201, 61, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 3, 7, "2025/01/31 12:00:00", 1020101, "ラビリスタ", -6.0, "2030/01/01 14:59:59", -285.0, 101, 5.18, 133701);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10201, 61, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 1, 2, "2025/01/31 12:00:00", 1020102, "クリスティーナ", -2.0, "2030/01/01 14:59:59", -285.0, 201, 8.77, 133901);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10201, 61, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 6, 1, "2025/01/31 12:00:00", 1020103, "ネネカ", 0.0, "2030/01/01 14:59:59", -285.0, 301, 15.5, 133801);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10202, 61, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 2, 5, "2025/02/28 12:00:00", 1020201, "ランファ", 0.0, "2030/01/01 14:59:59", -285.0, 101, 9.061, 134301);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10202, 61, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 1, 2, "2025/02/28 12:00:00", 1020202, "チカ", 0.0, "2030/01/01 14:59:59", -285.0, 201, 7.699, 134401);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10203, 61, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 1, 2, "2025/03/31 12:00:00", 1020301, "アオイ", 0.0, "2030/01/01 14:59:59", -285.0, 101, 8.595, 134601);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10203, 61, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 1, 2, "2025/03/31 12:00:00", 1020302, "クローチェ", 0.0, "2030/01/01 14:59:59", -285.0, 201, 7.758, 134501);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10204, 61, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 2, 6, "2025/04/30 12:00:00", 1020401, "ルイズマリー", 0.0, "2030/01/01 14:59:59", -285.0, 101, 7.0, 132302);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10204, 61, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 1, 2, "2025/04/30 12:00:00", 1020402, "イロハ", 0.0, "2030/01/01 14:59:59", -285.0, 201, 7.904, 132402);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10204, 61, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 4, 2, "2025/04/30 12:00:00", 1020403, "ソノ", 0.0, "2030/01/01 14:59:59", -285.0, 301, 8.487, 132502);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10205, 61, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 1, 2, "2025/05/31 12:00:00", 1020502, "カノン", 0.0, "2030/01/01 14:59:59", -285.0, 101, 8.763, 134901);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10205, 61, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 1, 3, "2025/05/31 12:00:00", 1020503, "ツムギ", 0.0, "2030/01/01 14:59:59", -285.0, 201, 6.417, 134801);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10206, 61, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 3, 7, "2025/06/30 12:00:00", 1020601, "エリス", 0.0, "2030/01/01 14:59:59", -285.0, 101, 10.335, 135001);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10206, 61, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 2, 4, "2025/06/30 12:00:00", 1020602, "シェフィ", 0.0, "2030/01/01 14:59:59", -285.0, 201, 6.281, 135101);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10206, 61, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 1, 2, "2025/06/30 12:00:00", 1020603, "プレシア", 0.0, "2030/01/01 14:59:59", -285.0, 301, 12.244, 135201);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10207, 61, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 2, 8, "2025/07/31 12:00:00", 1020701, "クリア", 0.0, "2030/01/01 14:59:59", -285.0, 101, 6.339, 135301);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10207, 61, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 7, 9, "2025/07/31 12:00:00", 1020702, "アネモネ", 0.0, "2030/01/01 14:59:59", -285.0, 201, 8.184, 135401);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10208, 61, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 9, 2, "2025/08/31 12:00:00", 1020801, "アイラ", 0.0, "2030/01/01 14:59:59", -285.0, 101, 3.906, 129101);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10208, 61, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 1, 2, "2025/08/31 12:00:00", 1020802, "シナツ", 0.0, "2030/01/01 14:59:59", -285.0, 201, 14.465, 129201);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10208, 61, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 4, 3, "2025/08/31 12:00:00", 1020803, "ヒヨリ", 0.0, "2030/01/01 14:59:59", -285.0, 301, 8.662, 100101);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10208, 61, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 1, 3, "2025/08/31 12:00:00", 1020804, "レイ", 0.0, "2030/01/01 14:59:59", -285.0, 401, 10.915, 100301);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10209, 61, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 1, 7, "2025/09/30 12:00:00", 1020901, "ユキノ", 0.0, "2030/01/01 14:59:59", -285.0, 101, 6.042, 135802);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10209, 61, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 4, 1, "2025/09/30 12:00:00", 1020902, "サツキ", 0.0, "2030/01/01 14:59:59", -285.0, 201, 9.402, 135903);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10209, 61, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 8, 1, "2025/09/30 12:00:00", 1020903, "ルルィ", 0.0, "2030/01/01 14:59:59", -285.0, 301, 8.16, 136902);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10210, 61, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 3, 2, "2025/10/31 12:00:00", 1021001, "カスミ", 0.0, "2030/01/01 14:59:59", -285.0, 101, 5.0, 137401);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10210, 61, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 4, 1, "2025/10/31 12:00:00", 1021002, "アラクネ", 0.0, "2030/01/01 14:59:59", -285.0, 201, 8.12, 136001);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10210, 61, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 4, 2, "2025/10/31 12:00:00", 1021003, "ナーナ", 0.0, "2030/01/01 14:59:59", -285.0, 301, 6.386, 136202);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10211, 61, "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 3, 4, "2025/11/30 12:00:00", 1021101, "ユイ", 0.0, "2030/01/01 14:59:59", -285.0, 101, 7.438, 136402);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10211, 61, "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 1, 5, "2025/11/30 12:00:00", 1021102, "ミソラ", 0.0, "2030/01/01 14:59:59", -285.0, 201, 8.35, 136302);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10212, 61, "新しい年がやってくるね！\nお正月の料理も飾りつけも、\nお姉ちゃんにお任せだよ♪\nみんなで楽しく新年を迎えよう！", 1, 2, "2025/12/31 12:00:00", 1021201, "シズル", 0.0, "2030/01/01 14:59:59", -285.0, 101, 5.0, 136501);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10212, 61, "おうちの掃除もトラブルも、 \n世界を揺るがす大ピンチも！\n今年のことは今年のうちに \nサッサと片付けちゃいますっ！", 1, 2, "2025/12/31 12:00:00", 1021202, "リノ", 0.0, "2030/01/01 14:59:59", -285.0, 201, 5.25, 137902);
INSERT INTO `v1_75329ac25c60f1e6ab7b07e35bdcdc32615cc1d96a0349050082a8f8467b4d37` VALUES (10212, 61, "年の瀬はギルドマスターも\nつい駆け回っちゃう忙しい時期だ！\n一年いろいろあったけど\nお互いイイ年を迎えよう、少年！", 1, 2, "2025/12/31 12:00:00", 1021203, "ラビリスタ", 0.0, "2030/01/01 14:59:59", -285.0, 301, 7.5, 106801);
